import './App.css';
import { Navbar, Container } from 'react-bootstrap';

function App() {
  return (
    <Navbar>
      <Container>
        <Navbar.Brand href="#home" bg="dark">LEGO Control</Navbar.Brand>
      </Container>
    </Navbar>
  );
}

export default App;
